import React from 'react';
import Item from './Item';

const List = props => {
   return (
       <div className = 'List'>
           {props.item.map(item => (
               <Item
                   item = {item}
                   key = {item.created}
               />
           ))}
       </div>
   )
}


export default ItemList;
